import base64
import os
import tempfile

# Base64 data
# http://scp-wiki-cn.wdfiles.com/local--files/hannah-s-personnel-file/Hannah.jpeg
HannahDotjpeg = ""


def Hannah():
    # Save to temporary file as jpeg image
    with tempfile.NamedTemporaryFile(suffix=".jpeg", delete=False) as f:
        f.write(base64.b64decode(HannahDotjpeg))

    # Print path
    print(f.name)

    # Open image with default application
    os.startfile(f.name)

    return f.name


if __name__ == "__main__":
    Hannah()
